import React, { Component } from 'react';
import './trailer.css';

class trailer extends Component{
    constructor(props) {
        super(props);
        this.state = {
            video: './dummy.mp4'
        };
    }

    render(){
        return(
            <section className="trailer-wrapper">
                <video 
                    src="./dummy.mp4"
                    type="video/mp4"
                    muted
                    loop
                    className="trailer"
                />
            </section>
        );
    }

}

export default trailer;
